import React, { Component } from 'react';

class TrendingStock extends Component {

    render() {
        const mystyle = {

              "colorTheme": "light",
              "dateRange": "12m",
              "exchange": "US",
              "showChart": true,
              "locale": "en",
              "largeChartUrl": "",
              "isTransparent": false,
              "width": "400",
              "height": "600",
              "plotLineColorGrowing": "rgba(33, 150, 243, 1)",
              "plotLineColorFalling": "rgba(33, 150, 243, 1)",
              "gridLineColor": "rgba(240, 243, 250, 1)",
              "scaleFontColor": "rgba(120, 123, 134, 1)",
              "belowLineFillColorGrowing": "rgba(33, 150, 243, 0.12)",
              "belowLineFillColorFalling": "rgba(33, 150, 243, 0.12)",
              "symbolActiveColor": "rgba(33, 150, 243, 0.12)"
            }

        return(

            <div class="tradingview-widget-container">
              <div class="tradingview-widget-container__widget"></div>
              <div class="tradingview-widget-copyright"><a href="https://www.tradingview.com/markets/stocks-usa/market-movers-gainers/" rel="noopener" target="_blank"><span class="blue-text">Stock Market</span></a> by TradingView</div>
              <script type="text/javascript" src="https://s3.tradingview.com/external-embedding/embed-widget-hotlists.js" style="mystyle" async>

              </script>
            </div>



        )
    }
}

export default TrendingStock;
